import bannerPic from './../../img/pictures/banner9.png'
import './banner.css'

const ExHeader = () => {
    return(
        <section class='banner'>
        <div class="container">
        <img src={bannerPic} alt="banner" />
        </div>
        
    </section>
    )
}

export default Banner;
